msg: "یک راهنمایی می خوام. ممنون می شم اگر ممکنه، پاسخ بدید. من می خوام یه تقویم درست کنم که اعضای گروه، اون رو به گوگل کلندر خودشون اضافه کنن. بعد من رویدادهایی رو که بهش اضافه می کنم، اون ها هم روی تقویم خودشون دریافت کنن. این امکان وجود داره؟"
